import React from "react";
import './Login.css';
import TopBar from '../TopBar/TopBar';

const Login = () => {

    return(
        <>
        <TopBar />
        <div id="loginBox">
        <label for="userName" className="userName">Username</label>  
        <input id="userName" className="userName" name="userName" placeholder="Enter user name" type="text" />
        <br />
        <label for="password" className="userName">Password</label>
        <input id="password" className="userName" name="password" placeholder="Password" type="Enter password" />
        </div>
        </>
    )


};

export default Login;
